         p8: '对于不同产品 iOS 11 也有优化，iPhone X 取消了 Home 键、用一个沉在底部的横条取代，像是退出应用这样基本的操作都被改变了；iPad 上的 iOS 11 增加了 Dock 栏，像 Mac 一样可以快速启动和切换应用。',
